  [],\n\t\"revision_timestamp\": \"2016-02-26T21:44:12.854567\",\n\t\"name\": \"heasarc-astronomical-archive-gliese2mas-gliese-catalog-stars-with-accurate-coordinates-and\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"This table contains precise epoch 2000 coordinates
  and cross-identifications to sources in the 2MASS Point Source Catalog for nearly
  all stars in the Gliese, Gliese-Jahreiss, and Woolley catalogs of nearby stars.
  The only Gliese objects where the authors were not successful are two Gliese sources
  that are actually QSOs; two proposed companions to brighter stars, which they believe
  do not exist; four stars included in one of the catalogs but identified there as
  only optical companions; one probable plate flaw; and two stars that simply remain
  unrecovered. For the 4251 recovered stars, 2693 have coordinates based on Hipparcos
  positions, 1549 have coordinates based on 2MASS data, and 9 have positions from
  other astrometric sources. All positions have been calculated at epoch 2000 using
  proper motions from the literature.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
